import{_ as e,c as a,o as i,d as o}from"./app.285df152.js";const y=JSON.parse('{"title":"Co to jest WeightBud?","description":"","frontmatter":{},"headers":[{"level":2,"title":"Dlaczego?","slug":"dlaczego","link":"#dlaczego","children":[]},{"level":2,"title":"Motywacja","slug":"motywacja","link":"#motywacja","children":[]},{"level":2,"title":"Czym si\u0119 wyr\xF3\u017Cniam?","slug":"czym-sie-wyrozniam","link":"#czym-sie-wyrozniam","children":[]}],"relativePath":"index.md"}'),t={name:"index.md"},n=o('<h1 id="co-to-jest-weightbud" tabindex="-1">Co to jest WeightBud? <a class="header-anchor" href="#co-to-jest-weightbud" aria-hidden="true">#</a></h1><p>WeightBud jest to aplikacja kt\xF3ra pozwala u\u017Cytkownikowi tworzy\u0107 plany treningowe i \u015Bledzi\u0107 swoje post\u0119py na si\u0142owni.</p><div class="danger custom-block"><p class="custom-block-title">Uwaga</p><p>Aplikacja wci\u0105\u017C jest w fazie rozwoju i ulega ci\u0105g\u0142ym zmian\u0105 architektury, projektu itp. dlatego obecne tu informacje najpewniej si\u0119 zmiani\u0105.</p></div><h2 id="dlaczego" tabindex="-1">Dlaczego? <a class="header-anchor" href="#dlaczego" aria-hidden="true">#</a></h2><p>Na planer zdecydowa\u0142em si\u0119 ze wzgl\u0119du na to jak bliska jest mi si\u0142ownia (pojawiam si\u0119 na niej codziennie) i wiem jak ci\u0119\u017Cko mo\u017Ce byc nowym osobom rozpocz\u0105\u0107 i zachowa\u0107 dan\u0105 rutyn\u0119, dlatego ten planer ma im w tym pom\xF3c, prznajmniej na pocz\u0105tku pogoni za wymarzon\u0105 sylewtk\u0105 lub zdrowiem psychicznym jak i fizycznym.</p><h2 id="motywacja" tabindex="-1">Motywacja <a class="header-anchor" href="#motywacja" aria-hidden="true">#</a></h2><p>Projekt ten oczywi\u015Bcie ze wzgl\u0119du na to \u017Ce staram si\u0119 o dobr\u0105 ocene z przedmiotu AMiD. Natomiast chcia\u0142bym do\u0142o\u017Cy\u0107 wszelkich stara\u0144 do jako\u015Bci tej aplikacji ze wzgl\u0119du na to \u017Ce bardzo ch\u0119tnie umie\u015Bci\u0142 bym j\u0105 w swoim portfolio na swojej osobistej stonie w celu zdobycia przysz\u0142ej klienteli.</p><h2 id="czym-sie-wyrozniam" tabindex="-1">Czym si\u0119 wyr\xF3\u017Cniam? <a class="header-anchor" href="#czym-sie-wyrozniam" aria-hidden="true">#</a></h2><p>Na Sklepie Play jest ju\u017C kilka takich planer\xF3w dobrej jako\u015Bci, wi\u0119c dlaczego m\xF3j mia\u0142by by\u0107 wyj\u0105tkowy? Przede wszystkim b\u0119dzie on Open Sourcowy - jego kod b\u0119dzie mo\u017Cna podejrze\u0107 na GitHubie oraz jest on projektowany przez osob\u0119 kt\xF3ra na codzie\u0144 ma styczno\u015B\u0107 z si\u0142owni\u0105 i wie jak wa\u017Cne jest trzymanie si\u0119 odpowiedniego zaplanowanego treningu. Nie b\u0119dzie ona r\xF3wnie\u017C posiada\u0142a \u017Cadnych p\u0142atnych funckji.</p>',9),c=[n];function r(s,d,l,z,m,w){return i(),a("div",null,c)}const j=e(t,[["render",r]]);export{y as __pageData,j as default};
